import React from "react";
import { Route } from "react-router-dom";

const Welcome = () => {
  return (
    <section>
      <h1>The Welcome page</h1>
      <Route path="/welcome/products/:welcomeId">
        Welcome new user
      </Route>
    </section>
  );
};

export default Welcome;
